function retrieveDataFromJSON(receivedData, sensorData) {
    const parsed = JSON.parse(receivedData)
    let component_name = ""
    let message_name = ""
    let field_name = ""
    let value = null

    try {
        parsed.forEach((message)=>{
            component_name = message["component_name"].toString()
            message_name = message["message_name"].toString()

            message["sensors"].forEach((sensor) => {
                field_name = sensor["field_name"].toString()

                if(sensor["field_name"] === undefined) {throw new Error("Received JSON is not well formatted")}
                sensorData.value.component_name.message_name.field_name = sensor["value"]
            })
        })
    }
    catch (err) {
        console.log(err)
    }
}

export default retrieveDataFromJSON
